class vast_xml_entity(object):

    def handleImpression(self, dom, ad_entity):
        impression_nodes = dom.getElementsByTagName("Impression")
        impression_list = []

        if impression_nodes.length > 0:
            for impression_node in impression_nodes:
                try:
                    impression_list.append(impression_node.childNodes[0].data)
                except:
                    pass
            ad_entity["events"].append(
                {"event": "impression", "skip_flag": False, "abs_ts": 0, "rel_ts": 0, "request_url": impression_list})
            return True
        else:
            # print u"Impression"
            return False

    def handleCreative(self, dom, ad_entity):
        # 
        duration = -1
        duration_nodes = dom.getElementsByTagName("Duration")
        duration_node = None
        if duration_nodes:
            duration_node = duration_nodes[0]
            try:
                duration_str = duration_node.childNodes[0].data
                s = duration_str.split(":")
                duration = int(s[2]) + 60 * int(s[1]) + 3600 * int(s[0])
            except:
                pass
            ad_entity['duration'] = duration

        if ad_entity["ad_type"] == "pause":
            duration = 5

        if duration > 0:
            tracking_events = ad_entity["events"]
            firstQuartileSec = math.floor(duration * 0.25)
            skip_firstQuartile = random_possibility.randomSkipImpression(firstQuartileSec)
            midpointSec = math.floor(duration * 0.5)
            skip_midpoint = random_possibility.randomSkipImpression(midpointSec)
            thirdQuartileSec = math.floor(duration * 0.75)
